import React, { Component } from 'react'


export default class Product extends Component {
    render() {

        return (
            <div>
                <div >
                    Filters
                </div>
                <div>
                    <input type="radio">Men</input>
                    <input type="radio">Women</input>
                    <input type="radio">Boys</input>
                    <input type="radio">Girls</input>
                </div>
            </div>
        );
    }
    }
